import React from 'react';
import { Container, Advertising } from './styles';
import { Button } from '@bentcare/core';

const FirstSection: React.FC = () => {
  return (
    <Container>
      <Advertising>
        <div>
          <p>
            Clube de Vantagens Bentcare Cuide da sua saúde com preço baixo e
            agilidade
          </p>
          <div>
            <Button label="Conhecer planos" />
            <Button label="Ligamos para você" />
          </div>
        </div>
      </Advertising>
    </Container>
  );
};

export default FirstSection;
